import XCTest

final class LeetCode1208Tests: XCTestCase {
  private let problem = LeetCode1208()

  func testExample1() {
    let result = problem.equalSubstring("abcd", "bcdf", 3)
    XCTAssertTrue(result == 3, "Expected '3', but got '\(result)'")
  }

  func testExample2() {
    let result = problem.equalSubstring("abcd", "cdef", 3)
    XCTAssertTrue(result == 1, "Expected '1', but got '\(result)'")
  }

  func testExample3() {
    let result = problem.equalSubstring("abcd", "acde", 0)
    XCTAssertTrue(result == 1, "Expected '1', but got '\(result)'")
  }

  func testExample4() {
    let result = problem.equalSubstring("krrgw", "zjxss", 19)
    XCTAssertTrue(result == 2, "Expected '2', but got '\(result)'")
  }

  func testExample5() {
    let result = problem.equalSubstring("abcd", "bccd", 1)
    XCTAssertTrue(result == 3, "Expected '3', but got '\(result)'")
  }

  func testExample6() {
    let result = problem.equalSubstring("agzxjgvcsubbxeyn", "nopafyvjfvekmnfp", 112)
    XCTAssertTrue(result == 12, "Expected '12', but got '\(result)'")
  }

  func testExample7() {
    let result = problem.equalSubstring("", "", 93020)
    XCTAssertTrue(result == 10948, "Expected '10948', but got '\(result)'")
  }
}
